import React from "react";
import defaultImg from "../images/room-1.jpeg";
function Room({ room }) {
  const { name, slug, price, images } = room;

  return (
    <article className="room">
      <div className="img-container">
        <img src={images[0]} alt="single room" />}
      </div>
    </article>
  );
}

export default Room;
